  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0129856 includes physical
  and profile data collected aboard the F.G. Walton Smith during cruise WS0901 in
  the Gulf of Mexico and North Atlantic Ocean from 2009-01-21 to 2009-01-25. These
  data include CONDUCTIVITY, SALINITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD. These data were collected by Elizabeth Johns
  of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory, and
  by Rosenstiel School of Marine and Atmospheric Science as part of NOAA South Florida
  Ecosystem Research and Monitoring Program. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
